INSERT INTO `wp_wc_admin_notes` VALUES (3,'wc-admin-add-first-product','info','en_US','Add your first product','Grow your revenue by adding products to your store. Add products manually, import from a sheet, or migrate from another platform.','product','{}','unactioned','woocommerce-admin','2020-04-12 20:17:20',NULL,0,'',NULL,0),(4,'wc-admin-wc-helper-connection','info','en_US','Connect to WooCommerce.com','Connect to get important product notifications and updates.','info','{}','unactioned','woocommerce-admin','2020-04-12 20:17:20',NULL,0,'',NULL,0),(5,'wc-admin-mobile-app','info','en_US','Install Woo mobile app','Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics  wherever you are.','info','{}','unactioned','woocommerce-admin','2020-09-26 19:50:53',NULL,0,'plain','',0),(6,'wc-admin-usage-tracking-opt-in','info','en_US','Help WooCommerce improve with usage tracking','Gathering usage data allows us to improve WooCommerce. Your store will be considered as we evaluate new features, judge the quality of an update, or determine if an improvement makes sense. You can always visit the <a href=\"http://localhost:8080/bh-wc-set-gateway-by-url/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com\" target=\"_blank\">Settings</a> and choose to stop sharing data. <a href=\"https://woocommerce.com/usage-tracking\" target=\"_blank\">Read more</a> about what data we collect.','info','{}','unactioned','woocommerce-admin','2020-09-26 19:50:53',NULL,0,'plain','',0),(7,'wc-admin-onboarding-email-marketing','info','en_US','Tips, product updates, and inspiration','We\'re here for you - get tips, product updates and inspiration straight to your email box','info','{}','unactioned','woocommerce-admin','2020-09-26 19:50:53',NULL,0,'plain','',0),(8,'wc-admin-marketing-intro','info','en_US','Connect with your audience','Grow your customer base and increase your sales with marketing tools built for WooCommerce.','info','{}','unactioned','woocommerce-admin','2020-09-26 19:50:53',NULL,0,'plain','',0),(9,'wc-admin-store-notice-giving-feedback-2','info','en_US','Give feedback','Now that youve chosen us as a partner, our goal is to make sure we\'re providing the right tools to meet your needs. We\'re looking forward to having your feedback on the store setup experience so we can improve it in the future.','info','{}','unactioned','woocommerce-admin','2020-09-26 19:50:53',NULL,0,'plain','',0),(10,'wc-admin-insight-first-sale','survey','en_US','Did you know?','A WooCommerce powered store needs on average 31 days to get the first sale. You\'re on the right track! Do you find this type of insight useful?','info','{}','unactioned','woocommerce-admin','2020-09-26 19:50:53',NULL,0,'plain','',0),(11,'wc-admin-learn-more-about-product-settings','info','en_US','Learn more about Product Settings','In this video you\'ll find information about configuring product settings, such as how they are displayed, editing inventory options and so on.','info','{}','unactioned','woocommerce-admin','2020-09-26 19:50:53',NULL,0,'plain','',0),(12,'wc-admin-real-time-order-alerts','info','en_US','Get real-time order alerts anywhere','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.','info','{}','unactioned','woocommerce-admin','2020-09-26 19:50:53',NULL,0,'plain','',0);
/*!40000 ALTER TABLE `wp_wc_admin_notes` ENABLE KEYS */;
